--
-- Table structure for table `asset`
--

DROP TABLE IF EXISTS `asset`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `asset` (
  `id` bigint NOT NULL AUTO_INCREMENT,
  `asset_code` varchar(50) DEFAULT NULL,
  `asset_name` varchar(100) NOT NULL,
  `device_name` varchar(100) DEFAULT NULL,
  `category_id` bigint DEFAULT NULL,
  `manufacturer` varchar(100) DEFAULT NULL,
  `model` varchar(100) DEFAULT NULL,
  `serial_number` varchar(100) DEFAULT NULL,
  `purchase_date` date DEFAULT NULL,
  `purchase_price` decimal(12,2) DEFAULT NULL,
  `supplier` varchar(100) DEFAULT NULL,
  `warranty_period` int DEFAULT NULL,
  `warranty_expire_date` date DEFAULT NULL,
  `asset_status` varchar(20) DEFAULT 'offline',
  `owner` varchar(50) DEFAULT NULL,
  `department` varchar(100) DEFAULT NULL,
  `location` varchar(255) DEFAULT NULL,
  `ip_address` varchar(50) DEFAULT NULL,
  `mac_address` varchar(50) DEFAULT NULL,
  `depreciation_years` int DEFAULT NULL,
  `current_value` decimal(12,2) DEFAULT NULL,
  `description` text,
  `cpu_usage` decimal(5,2) DEFAULT '0.00' COMMENT 'CPU使用率',
  `cpu_cores` int DEFAULT '0' COMMENT 'CPU核心数',
  `cpu_load` decimal(5,2) DEFAULT '0.00' COMMENT 'CPU负载',
  `memory_usage` decimal(5,2) DEFAULT '0.00' COMMENT '内存使用率',
  `memory_used` decimal(20,2) DEFAULT '0.00' COMMENT '已用内存(GB)',
  `memory_total` decimal(20,2) DEFAULT '0.00' COMMENT '总内存(GB)',
  `network_usage` decimal(5,2) DEFAULT '0.00' COMMENT '网络使用率',
  `network_in` decimal(20,2) DEFAULT '0.00' COMMENT '网络入流量(Gbps)',
  `network_out` decimal(20,2) DEFAULT '0.00' COMMENT '网络出流量(Gbps)',
  `storage_usage` decimal(5,2) DEFAULT '0.00' COMMENT '存储使用率',
  `storage_used` decimal(20,2) DEFAULT '0.00' COMMENT '已用存储(TB)',
  `storage_total` decimal(20,2) DEFAULT '0.00' COMMENT '总存储(TB)',
  `bandwidth` decimal(10,2) DEFAULT '1.00' COMMENT '带宽(Gbps)',
  `tags` varchar(500) DEFAULT NULL,
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP,
  `update_time` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `deleted` int DEFAULT '0',
  `datacenter_id` bigint DEFAULT NULL COMMENT '所属机房ID',
  PRIMARY KEY (`id`),
  KEY `idx_category_id` (`category_id`)
) ENGINE=InnoDB AUTO_INCREMENT=36 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

