DROP TABLE IF EXISTS `prediction_result`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `prediction_result` (
  `id` bigint NOT NULL AUTO_INCREMENT,
  `service_id` bigint DEFAULT NULL,
  `device_id` bigint DEFAULT NULL,
  `model_id` bigint DEFAULT NULL,
  `category_id` bigint DEFAULT NULL,
  `metric_name` varchar(50) DEFAULT NULL,
  `algorithm_type` varchar(50) DEFAULT NULL,
  `predicted_value` decimal(20,4) DEFAULT NULL,
  `actual_value` decimal(20,4) DEFAULT NULL,
  `is_anomalous` int DEFAULT '0',
  `confidence` decimal(5,4) DEFAULT NULL,
  `accuracy` decimal(5,2) DEFAULT NULL COMMENT '预测准确度百分比',
  `prediction_time` datetime DEFAULT NULL,
  `prediction_for_time` datetime DEFAULT NULL,
  `model_version` varchar(50) DEFAULT NULL,
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP,
  `update_time` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=877 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
