DROP TABLE IF EXISTS `resource_monitor`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `resource_monitor` (
  `id` bigint NOT NULL AUTO_INCREMENT,
  `device_id` bigint NOT NULL COMMENT '设备ID',
  `device_name` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '设备名称',
  `device_type` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '设备类型(physical/virtual/container)',
  `cpu_usage` decimal(5,2) DEFAULT '0.00' COMMENT 'CPU使用率',
  `cpu_cores` int DEFAULT '0' COMMENT 'CPU核心数',
  `cpu_load` decimal(5,2) DEFAULT '0.00' COMMENT 'CPU负载',
  `memory_usage` decimal(5,2) DEFAULT '0.00' COMMENT '内存使用率',
  `memory_used` decimal(20,2) DEFAULT '0.00' COMMENT '已用内存(GB)',
  `memory_total` decimal(20,2) DEFAULT '0.00' COMMENT '总内存(GB)',
  `network_usage` decimal(5,2) DEFAULT '0.00' COMMENT '网络使用率',
  `network_in` decimal(20,2) DEFAULT '0.00' COMMENT '网络入流量(Gbps)',
  `network_out` decimal(20,2) DEFAULT '0.00' COMMENT '网络出流量(Gbps)',
  `storage_usage` decimal(5,2) DEFAULT '0.00' COMMENT '存储使用率',
  `storage_used` decimal(20,2) DEFAULT '0.00' COMMENT '已用存储(PB)',
  `storage_total` decimal(20,2) DEFAULT '0.00' COMMENT '总存储(PB)',
  `record_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '记录时间',
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `idx_device_id` (`device_id`),
  KEY `idx_record_time` (`record_time`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='资源监控数据表';
